import { React } from "react";
import "./script1";

const Aladin = () => {
  React.useEffect(() => {
    let aladin = A.aladin("#aladin-lite-div", {
      survey: "P/DSS2/color",
      fov: 60,
    });
    aladin.setFov(1);
  }, []);

  return (
    <div id="aladin-lite-div" style={{ width: "400px", height: "400px" }} />
  );
};

export default Aladin;
